import { useEffect, useState } from 'react'

function App() {

  const[personajes,setPersonajes]=useState([])

  useEffect(()=>{
    axios.get('https://gateway.marvel.com:443/v1/public/characters?ts=1apikey=4e4262f5add91c0e7887e0437a7f87c8hash=bf28c6b8a294cb19965af89efdf86d6a')
    .then(res=>{
      setPersonajes(res.data)
      console.log(res.data)
    })
    .cath(error=>console.log(error))

  },[])

  return (
    <div className="App">
      <h1>Marvel</h1>
    </div>
  );
}

export default App;
